import './index.css';
import SearchIcon from "./search.svg"

function App() {
  return (
    <>
      <div>
        <h1>Movie Land</h1>
      </div>

      <div>
        <input type="text"
         placeholder='write your movie title here'
         onChange={() => {}}
        />

        <img
         src={SearchIcon}
         alt="Search"
         onClick={() => {}}
           />
      </div>
    </>
  );
}

export default App;
